package conditon2;

public class homework1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for(int i=0;i<100;i++) {
		
			if(i/10==5) {
				System.out.println(i);
				continue;
			}
			
			else if(i%10==5) System.out.println(i);
	
			
		}
	}

}
